handleLineChart=function() {
    "use strict";
    nv.addGraph(function() {
        for(var e=[], a=[], r=0;
        100>r;
        r++)e.push( {
            x: r, y: Math.sin(r/10)
        }
        ),
        a.push( {
            x: r, y: .5*Math.cos(r/10)
        }
        );
        var t=[ {
            values: e, key: "Sine Wave", color: green
        }
        ,
        {
            values: a, key: "Cosine Wave", color: blue
        }
        ],
        n=nv.models.lineChart().options( {
            transitionDuration: 300, useInteractiveGuideline: !0
        }
        );
        return n.xAxis.axisLabel("Time (s)").tickFormat(d3.format(",.1f")),
        n.yAxis.axisLabel("Voltage (v)").tickFormat(function(e) {
            return null==e?"N/A": d3.format(",.2f")(e)
        }
        ),
        d3.select("#nv-line-chart").append("svg").datum(t).call(n),
        nv.utils.windowResize(n.update),
        n
    }
    )
}
,
